import CustomNav from "../customNav/CustomNav";
import "./Menu.css";
import React, { useEffect, useState } from 'react';


function Menu() {

  const [filmData, setFilmData] = useState([]);

  useEffect(() => {
    fetch('https://gist.githubusercontent.com/saniyusuf/406b843afdfb9c6a86e25753fe2761f4/raw/523c324c7fcc36efab8224f9ebb7556c09b69a14/Film.JSON')
      .then(response => response.json())
      .then(data => setFilmData(data))
      .catch(error => console.log(error));
  }, []);


  return (
    <div className="text-white">

      <CustomNav />

      <div className="container">
        <div className="row">
          <div className="col">

          </div>
          <div className="col">
            
          </div>
          <div className="col">
          
          </div>
          <div className="col">
          
          </div>
        </div>
      </div>

      <h1>Menu</h1>
      <p>Bienvenido al panel de control después de iniciar sesión.</p>
      {filmData.map(film => (
        <h3>{JSON.stringify(film)}</h3>
      ))}
    </div>
  );
}

export default Menu;
